    "channel-islands-kelp-forest-monitoring-sea-temperature",nt"isopen": false,nt"url":
    null,nt"notes": "This dataset from the Channel Islands National Park's Kelp
    Forest Monitoring Program has subtidal temperature data taken at permanent monitoring
    sites.  Since 1993, remote temperature loggers manufactured by Onset Computer Corporation
    were deployed at each site approximately 10-20 cm from the bottom in a underwater
    housing.  Since 1993, three models of temperature loggers (HoboTemp (tm), StowAway
    (R) and Tidbit(R)) were used to collect temperature data every 1-5 hours depending
    on the model used.",nt"license_title": null,nt"extras": [{ntt"key":
